import React from 'react';
import { useLocation } from 'react-router-dom';

function FoodChoices() {
  const location = useLocation();
  const queryParams = new URLSearchParams(location.search);
  const preference = queryParams.get('preference');

  return (
    <div className="food-choices-container">
      <h1>Food Choices for {preference}</h1>
      <button className="food-choice-button">Fruits</button>
      <button className="food-choice-button">Vegetables</button>
      <button className="food-choice-button">Whole Grains</button>
      <button className="food-choice-button">Lean Protein</button>
    </div>
  );
}

export default FoodChoices;
